Superboy - Smallville Attacks [Jeff Lamire] (2011)

Superboy is back in a brand-new ongoing series! Join Jeff Lemire (SWEET TOOTH) and amazing up-and-coming artist Pier Gallo as they take Superboy on a journey to a side of Smallville not even Superman knows about! What mysteries lurk beneath the surface of this all-American town - and what are their direct ties to Superboy? The start of the next great DC Universe epic begins. Contains issues 1 - 11.

